import React from "react";
import CatList from "./CatList";

function CatPage({ cats, setCats, matched, setMatch }) {

  return (
    <main>
            <CatList 
                cats={cats}
                setCats={setCats}
                matched={matched} 
                setMatch={setMatch}
            />
    </main>
  );
}

export default CatPage;
